print('/*******************  CREATE TEMPORARY table for canned panels column *******************/')
Create TABLE #TampCannedPanelColumn 
(
	[intPanelColumnId] [int] NOT NULL,
	[intPanelId] [int] NOT NULL,
	[strColumn] [nvarchar](max) NULL,
	[strCaption] [nvarchar](max) NULL,
	[intWidth] [smallint] NOT NULL,
	[strAlignment] [nvarchar](max) NULL,
	[strArea] [nvarchar](max) NULL,
	[strFooter] [nvarchar](max) NULL,
	[strFormat] [nvarchar](max) NULL,
	[intSort] [smallint] NOT NULL,
	[strFormatTrue] [nvarchar](max) NULL,
	[strFormatFalse] [nvarchar](max) NULL,
	[strDrillDownColumn] [nvarchar](max) NULL,
	[ysnVisible] [bit] NOT NULL,
	[strType] [nvarchar](max) NULL,
	[strAxis] [nvarchar](max) NULL,
	[strUserName] [nvarchar](max) NULL,
	[intUserId] [int] NOT NULL,
	[intDonut] [smallint] NOT NULL,
	[intMinInterval] [smallint] NOT NULL,
	[intMaxInterval] [smallint] NOT NULL,
	[intStepInterval] [smallint] NOT NULL,
	[strIntervalFormat] [nvarchar](max) NULL,
	[ysnHiddenColumn] [bit] NOT NULL,	
	[intCannedPanelId] [int] NOT NULL	 	
)

print('/*******************  BEGIN INSERTING canned panels on temporary panel column table  *******************/')
print('/*******************  END INSERTING canned panels on temporary panel column table  *******************/')

print('/*******************  BEGIN DELETE old panel column records  *******************/')

DELETE tblDBPanelColumn WHERE intCannedPanelId != 0

print('/*******************  END DELETE old panel column records  *******************/')


print('/*******************  BEGIN UPDATING canned panels on table Panel Column  *******************/')

DECLARE @intPanelColumnId int
DECLARE @intCannedPanelId int
DECLARE @intCurrentPanelId int

DECLARE db_cursor CURSOR FOR  
SELECT intPanelColumnId, intCannedPanelId FROM #TampCannedPanelColumn
 

OPEN db_cursor   
FETCH NEXT FROM db_cursor INTO @intPanelColumnId, @intCannedPanelId

WHILE @@FETCH_STATUS = 0   
BEGIN
	SET @intCurrentPanelId = (SELECT TOP 1 intPanelId FROM tblDBPanel WHERE intCannedPanelId = @intCannedPanelId)
		
	SELECT @intCurrentPanelId, [strColumn], [strCaption], [intWidth], [strAlignment], [strArea], [strFooter], [strFormat], [intSort], [strFormatTrue], [strFormatFalse], [strDrillDownColumn], [ysnVisible], [strType], [strAxis], [strUserName], [intUserId], [intDonut], [intMinInterval], [intMaxInterval], [intStepInterval], [strIntervalFormat], [ysnHiddenColumn], [intCannedPanelId]
	FROM #TampCannedPanelColumn 
	WHERE intPanelColumnId = @intPanelColumnId

	
FETCH NEXT FROM db_cursor INTO @intPanelColumnId, @intCannedPanelId
END   

CLOSE db_cursor   
DEALLOCATE db_cursor

DROP TABLE #TampCannedPanelColumn
print('/*******************  END UPDATING canned panels on table Panel Column  *******************/')
/*******************  END UPDATING canned panels on table Panel Column*******************/
GO